import Personel from "@/models/PersonelModel"

export default {
    getPersonel(){
        const personel=new Personel(123,1234567890,"engin","hazar",141.47,'2022-12-29',"yüzüncü yıl mahallesi");
        return personel; 
    },

    savePersonel(personelModel ){
        alert("save")
        alert("Save :"+personelModel);

    }
}
